        `},leadership:{title:"Institutional Leadership",content:"<h3>Governing Body</h3><p>The college is governed by a dedicated body of scholars and administrators committed to academic excellence.</p>"},organogram:{title:"College Organogram",content:"<h3>Organizational Structure</h3><p>A detailed view of the hierarchical structure of H.H. The Rajah's College, from the Principal to the department heads and administrative staff.</p>"},curriculum:{title:"Academic Curriculum",content:"<h3>UG & PG Curriculum</h3><p>Our curriculum is designed to meet global standards while maintaining local relevance, approved by the Bharathidasan University.</p>"},calendar:{title:"Academic Calendar",content:"<h3>Important Dates</h3><p>Stay updated with the semester schedules, examination dates, and public holidays for the current academic year.</p>"},library:{title:"College Library",content:"<h3>Resource Center</h3><p>Our library houses over 50,000 books and a wide range of digital resources available for students and faculty.</p>"},hostel:{title:"Hostel Facilities",content:"<h3>On-Campus Accommodation</h3><p>Separate hostels for boys and girls with modern amenities and a safe environment for rural students.</p>"},gym:{title:"Fitness & Gym",content:"<h3>Physical Wellness</h3><p>A fully equipped gymnasium is available to promote the health and fitness of our students.</p>"},transport:{title:"Transport Services",content:"<h3>College Connectivity</h3><p>Regular bus services connecting the college to various parts of Pudukkottai and surrounding rural areas.</p>"},gallery:{title:"Campus Gallery",content:"<h3>Life at H.H. Rajah's</h3><p>Visual highlights of our campus, academic events, and cultural festivals.</p>"},announcements:{title:"Official Announcements",content:"<h3>Stay Informed</h3><p>Latest notifications regarding admissions, exams, and scholarship opportunities.</p>"},"news-events":{title:"News & Events",content:"<h3>Happening Now</h3><p>Updates on workshops, seminars, and achievements of our students and faculty members.</p>"},"rank-holders":{title:"Academic Rank Holders",content:"<h3>Our Hall of Fame</h3><p>Celebrating the excellence of students who have secured top ranks in University examinations.</p>"},"job-application":{title:"Job Applications",content:"<h3>Career Opportunities</h3><p>Join the team at H.H. The Rajah's College. Explore current academic and administrative openings.</p>"},"curriculum-committee":{title:"Curriculum Committee",content:"<h3>Academic Planning</h3><p>Ensuring the continuous improvement and relevance of our course offerings.</p>"},"anti-ragging":{title:"Anti Ragging Committee",content:"<h3>Safe Campus Policy</h3><p>Zero tolerance towards ragging. We ensure a safe and supportive environment for all newcomers.</p>"},"students-welfare":{title:"Students Welfare Committee",content:"<h3>Student Support</h3><p>Dedicated to resolving student issues and providing scholarships and financial aid.</p>"},grievance:{title:"Grievance Redressal Cell",content:"<h3>Internal Complaints Committee</h3><p>A formal mechanism for students and staff to raise and resolve concerns.</p>"},research:{title:"Research Committee",content:"<h3>Innovation Hub</h3><p>Supporting faculty and Ph.D. scholars in their pursuit of original research and publications.</p>"},address:{title:"Campus Address",content:"<h3>Locate Us</h3><p>H.H. The Rajah's College (Autonomous), Pudukkottai, Tamil Nadu - 622001.</p>"},"contact-numbers":{title:"Contact Numbers",content:"<h3>Direct Lines</h3><p>Office: 04322-230490<br/>Principal: 04322-230491</p>"},"email-support":{title:"Email Support",content:"<h3>Digital Correspondence</h3><p>General: hhrajahscollege@gmail.com<br/>Admissions: admission@hhrc.ac.in</p>"},map:{title:"Find Us on Map",content:"<h3>Google Maps Integration</h3><p>View our campus location on North Main Street, Pudukkottai.</p>"},"general-feedback":{title:"General Feedback",content:"<h3>Share Your Thoughts</h3><p>We value your opinion on our institutional services and facilities.</p>"},"course-feedback":{title:"Course Feedback",content:"<h3>Academic Evaluation</h3><p>Students can provide feedback on their respective courses and learning experiences.</p>"},"institutional-quality":{title:"Institutional Quality Feedback",content:"<h3>IQAC Initiatives</h3><p>Feedback for the Internal Quality Assurance Cell to help maintain academic standards.</p>"},"coe-office":{title:"Controller of Examinations (CoE) Office",content:`
